<span class="hljs-built_in">print</span>(predictions)`,wrap:!1}}),{c(){M(t.$$.fragment)},l(a){h(t.$$.fragment,a)},m(a,T){J(t,a,T),j=!0},i(a){j||(o(t.$$.fragment,a),j=!0)},o(a){c(t.$$.fragment,a),j=!1},d(a){y(t,a)}}}function ot(U){let t,j,a,T,k,b,C,A,f,I,g,$,r='In this section we will take a closer look at the capabilities of the tokenizers in ü§ó Transformers. Up to now we have only used them to tokenize inputs or decode IDs back into text, but tokenizers ‚Äî especially those backed by the ü§ó Tokenizers library ‚Äî can do a lot more. To illustrate these additional features, we will explore how to reproduce the results of the <code>token-classification</code> (that we called <code>ner</code>) and <code>question-answering</code> pipelines that we first encountered in <a href="/course/chapter1">Chapter 1</a>.',x,R,je,H,qn='In the following discussion, we will often make the distinction between ‚Äúslow‚Äù and ‚Äúfast‚Äù tokenizers. Slow tokenizers are those written in Python inside the ü§ó Transformers library, while the fast versions are the ones provided by ü§ó Tokenizers, which are written in Rust. If you remember the table from <a href="/course/chapter5/3">Chapter 5</a> that reported how long it took a fast and a slow tokenizer to tokenize the Drug Review Dataset, you should have an idea of why we call them fast and slow:',we,V,Pn='<thead><tr><th align="center"></th> <th align="center">Fast tokenizer</th> <th align="center">Slow tokenizer</th></tr></thead> <tbody><tr><td align="center"><code>batched=True</code></td> <td align="center">10.8s</td> <td align="center">4min41s</td></tr> <tr><td align="center"><code>batched=False</code></td> <td align="center">59.2s</td> <td align="center">5min3s</td></tr></tbody>',de,S,Te,X,ue,G,me,D,On="The output of a tokenizer isn‚Äôt a simple Python dictionary; what we get is actually a special <code>BatchEncoding</code> object. It‚Äôs a subclass of a dictionary (which is why we were able to index into that result without any problem before), but with additional methods that are mostly used by fast tokenizers.",be,Y,Kn="Besides their parallelization capabilities, the key functionality of fast tokenizers is that they always keep track of the original span of texts the final tokens come from ‚Äî a feature we call <em>offset mapping</em>. This in turn unlocks features like mapping each word to the tokens it generated or mapping each character of the original text to the token it‚Äôs inside, and vice versa.",fe,L,sl="Let‚Äôs take a look at an example:",Ue,F,xe,q,el="As mentioned previously, we get a <code>BatchEncoding</code> object in the tokenizer‚Äôs output:",ge,P,ke,O,nl="Since the <code>AutoTokenizer</code> class picks a fast tokenizer by default, we can use the additional methods this <code>BatchEncoding</code> object provides. We have two ways to check if our tokenizer is a fast or a slow one. We can either check the attribute <code>is_fast</code> of the <code>tokenizer</code>:",Ie,K,Ce,ss,$e,es,ll="or check the same attribute of our <code>encoding</code>:",Ae,ns,Qe,ls,Be,ts,tl="Let‚Äôs see what a fast tokenizer enables us to do. First, we can access the tokens without having to convert the IDs back to tokens:",Ze,as,ze,ps,Ne,is,al="In this case the token at index 5 is <code>##yl</code>, which is part of the word ‚ÄúSylvain‚Äù in the original sentence. We can also use the <code>word_ids()</code> method to get the index of the word each token comes from:",Ee,rs,Se,cs,ve,os,pl="We can see that the tokenizer‚Äôs special tokens <code>[CLS]</code> and <code>[SEP]</code> are mapped to <code>None</code>, and then each token is mapped to the word it originates from. This is especially useful to determine if a token is at the start of a word or if two tokens are in the same word. We could rely on the <code>##</code> prefix for that, but it only works for BERT-like tokenizers; this method works for any type of tokenizer as long as it‚Äôs a fast one. In the next chapter, we‚Äôll see how we can use this capability to apply the labels we have for each word properly to the tokens in tasks like named entity recognition (NER) and part-of-speech (POS) tagging. We can also use it to mask all the tokens coming from the same word in masked language modeling (a technique called <em>whole word masking</em>).",We,v,_e,Ms,il="Similarly, there is a <code>sentence_ids()</code> method that we can use to map a token to the sentence it came from (though in this case, the <code>token_type_ids</code> returned by the tokenizer can give us the same information).",Re,hs,rl="Lastly, we can map any word or token to characters in the original text, and vice versa, via the <code>word_to_chars()</code> or <code>token_to_chars()</code> and <code>char_to_word()</code> or <code>char_to_token()</code> methods. For instance, the <code>word_ids()</code> method told us that <code>##yl</code> is part of the word at index 3, but which word is it in the sentence? We can find out like this:",He,Js,Ve,ys,Xe,js,cl="As we mentioned previously, this is all powered by the fact the fast tokenizer keeps track of the span of text each token comes from in a list of <em>offsets</em>. To illustrate their use, next we‚Äôll show you how to replicate the results of the <code>token-classification</code> pipeline manually.",Ge,W,De,ws,Ye,ds,ol='In <a href="/course/chapter1">Chapter 1</a> we got our first taste of applying NER ‚Äî where the task is to identify which parts of the text correspond to entities like persons, locations, or organizations ‚Äî with the ü§ó Transformers <code>pipeline()</code> function. Then, in <a href="/course/chapter2">Chapter 2</a>, we saw how a pipeline groups together the three stages necessary to get the predictions from a raw text: tokenization, passing the inputs through the model, and post-processing. The first two steps in the <code>token-classification</code> pipeline are the same as in any other pipeline, but the post-processing is a little more complex ‚Äî let‚Äôs see how!',Le,Q,B,oe,Ts,Fe,us,Ml='First, let‚Äôs grab a token classification pipeline so we can get some results to compare manually. The model used by default is <a href="https://huggingface.co/dbmdz/bert-large-cased-finetuned-conll03-english" rel="nofollow"><code>dbmdz/bert-large-cased-finetuned-conll03-english</code></a>; it performs NER on sentences:',qe,ms,Pe,bs,Oe,fs,hl="The model properly identified each token generated by ‚ÄúSylvain‚Äù as a person, each token generated by ‚ÄúHugging Face‚Äù as an organization, and the token ‚ÄúBrooklyn‚Äù as a location. We can also ask the pipeline to group together the tokens that correspond to the same entity:",Ke,Us,sn,xs,en,gs,Jl="The <code>aggregation_strategy</code> picked will change the scores computed for each grouped entity. With <code>&quot;simple&quot;</code> the score is just the mean of the scores of each token in the given entity: for instance, the score of ‚ÄúSylvain‚Äù is the mean of the scores we saw in the previous example for the tokens <code>S</code>, <code>##yl</code>, <code>##va</code>, and <code>##in</code>. Other strategies available are:",nn,ks,yl="<li><code>&quot;first&quot;</code>, where the score of each entity is the score of the first token of that entity (so for ‚ÄúSylvain‚Äù it would be 0.993828, the score of the token <code>S</code>)</li> <li><code>&quot;max&quot;</code>, where the score of each entity is the maximum score of the tokens in that entity (so for ‚ÄúHugging Face‚Äù it would be 0.98879766, the score of ‚ÄúFace‚Äù)</li> <li><code>&quot;average&quot;</code>, where the score of each entity is the average of the scores of the words composing that entity (so for ‚ÄúSylvain‚Äù there would be no difference from the <code>&quot;simple&quot;</code> strategy, but ‚ÄúHugging Face‚Äù would have a score of 0.9819, the average of the scores for ‚ÄúHugging‚Äù, 0.975, and ‚ÄúFace‚Äù, 0.98879)</li>",ln,Is,jl="Now let‚Äôs see how to obtain these results without using the <code>pipeline()</code> function!",tn,Cs,an,Z,z,Me,$s,wl="We have a batch with 1 sequence of 19 tokens and the model has 9 different labels, so the output of the model has a shape of 1 x 19 x 9. Like for the text classification pipeline, we use a softmax function to convert those logits to probabilities, and we take the argmax to get predictions (note that we can take the argmax on the logits because the softmax does not change the order):",pn,N,E,he,As,rn,Qs,dl="The <code>model.config.id2label</code> attribute contains the mapping of indexes to labels that we can use to make sense of the predictions:",cn,Bs,on,Zs,Mn,zs,Tl="As we saw earlier, there are 9 labels: <code>O</code> is the label for the tokens that are not in any named entity (it stands for ‚Äúoutside‚Äù), and we then have two labels for each type of entity (miscellaneous, person, organization, and location). The label <code>B-XXX</code> indicates the token is at the beginning of an entity <code>XXX</code> and the label <code>I-XXX</code> indicates the token is inside the entity <code>XXX</code>. For instance, in the current example we would expect our model to classify the token <code>S</code> as <code>B-PER</code> (beginning of a person entity) and the tokens <code>##yl</code>, <code>##va</code> and <code>##in</code> as <code>I-PER</code> (inside a person entity).",hn,Ns,ul="You might think the model was wrong in this case as it gave the label <code>I-PER</code> to all four of these tokens, but that‚Äôs not entirely true. There are actually two formats for those <code>B-</code> and <code>I-</code> labels: <em>IOB1</em> and <em>IOB2</em>. The IOB2 format (in pink below), is the one we introduced whereas in the IOB1 format (in blue), the labels beginning with <code>B-</code> are only ever used to separate two adjacent entities of the same type. The model we are using was fine-tuned on a dataset using that format, which is why it assigns the label <code>I-PER</code> to the <code>S</code> token.",Jn,_,ml='<img class="block dark:hidden" src="https://huggingface.co/datasets/huggingface-course/documentation-images/resolve/main/en/chapter6/IOB_versions.svg" alt="IOB1 vs IOB2 format"/> <img class="hidden dark:block" src="https://huggingface.co/datasets/huggingface-course/documentation-images/resolve/main/en/chapter6/IOB_versions-dark.svg" alt="IOB1 vs IOB2 format"/>',yn,Es,bl="With this map, we are ready to reproduce (almost entirely) the results of the first pipeline ‚Äî we can just grab the score and label of each token that was not classified as <code>O</code>:",jn,Ss,wn,vs,dn,Ws,fl="This is very similar to what we had before, with one exception: the pipeline also gave us information about the <code>start</code> and <code>end</code> of each entity in the original sentence. This is where our offset mapping will come into play. To get the offsets, we just have to set <code>return_offsets_mapping=True</code> when we apply the tokenizer to our inputs:",Tn,_s,un,Rs,mn,Hs,Ul="Each tuple is the span of text corresponding to each token, where <code>(0, 0)</code> is reserved for the special tokens. We saw before that the token at index 5 is <code>##yl</code>, which has <code>(12, 14)</code> as offsets here. If we grab the corresponding slice in our example:",bn,Vs,fn,Xs,xl="we get the proper span of text without the <code>##</code>:",Un,Gs,xn,Ds,gl="Using this, we can now complete the previous results:",gn,Ys,kn,Ls,In,Fs,kl="This is the same as what we got from the first pipeline!",Cn,qs,$n,Ps,Il="Using the offsets to determine the start and end keys for each entity is handy, but that information isn‚Äôt strictly necessary. When we want to group the entities together, however, the offsets will save us a lot of messy code. For example, if we wanted to group together the tokens <code>Hu</code>, <code>##gging</code>, and <code>Face</code>, we could make special rules that say the first two should be attached while removing the <code>##</code>, and the <code>Face</code> should be added with a space since it does not begin with <code>##</code> ‚Äî but that would only work for this particular type of tokenizer. We would have to write another set of rules for a SentencePiece or a Byte-Pair-Encoding tokenizer (discussed later in this chapter).",An,Os,Cl="With the offsets, all that custom code goes away: we just can take the span in the original text that begins with the first token and ends with the last token. So, in the case of the tokens <code>Hu</code>, <code>##gging</code>, and <code>Face</code>, we should start at character 33 (the beginning of <code>Hu</code>) and end before character 45 (the end of <code>Face</code>):",Qn,Ks,Bn,se,Zn,ee,$l="To write the code that post-processes the predictions while grouping entities, we will group together entities that are consecutive and labeled with <code>I-XXX</code>, except for the first one, which can be labeled as <code>B-XXX</code> or <code>I-XXX</code> (so, we stop grouping an entity when we get a <code>O</code>, a new type of entity, or a <code>B-XXX</code> that tells us an entity of the same type is starting):",zn,ne,Nn,le,Al="And we get the same results as with our second pipeline!",En,te,Sn,ae,Ql="Another example of a task where these offsets are extremely useful is question answering. Diving into that pipeline, which we‚Äôll do in the next section, will also enable us to take a look at one last feature of the tokenizers in the ü§ó Transformers library: dealing with overflowing tokens when we truncate an input to a given length.",vn,ye,Wn;k=new Ol({props:{fw:U[0]}}),C=new Je({props:{title:"Fast tokenizers‚Äô special powers",local:"fast-tokenizers-special-powers",headingTag:"h1"}});const Bl=[st,Kl],pe=[];function Zl(s,e){return s[0]==="pt"?0:1}f=Zl(U),I=pe[f]=Bl[f](U),R=new Hn({props:{id:"g8quOxoqhHQ"}}),S=new Ln({props:{warning:!0,$$slots:{default:[et]},$$scope:{ctx:U}}}),X=new Je({props:{title:"Batch encoding",local:"batch-encoding",headingTag:"h2"}}),G=new Hn({props:{id:"3umI3tm27Vw"}}),F=new m({props:{code:"",highlighted:`<s